// Make sure to import the WeatherDisplay component
import WeatherDisplay from './components/WeatherDisplay'; // Adjust the path as necessary
import Todos from './components/Todos/Todos';

function App() {
  // Define a city for the weather display, this can be dynamic based on user input or settings
  const city = 'New York'; // This is just a placeholder; you could make it dynamic

  return (
    <div className='app'>
      <section className='todos'>
        <header>
          <h1>To-Do List</h1>
          {/* WeatherDisplay component inserted below the main heading */}
          <WeatherDisplay city={city} />
        </header>
        <Todos />
      </section>
    </div>
  )
}

export default App;
